import React from "react";
import {Link} from 'react-router-dom'
import { Grid, TextField, Button, Typography } from "@material-ui/core";

export default function Login() {
  return (
      <>
      <div className='nav-header' style={{background:'#4A47A3', height: "40px"}}>
          <Link to='/' style={{color: "white", textDecoration: "none", text: "center"}} >EDU Community</Link>
      </div>
    <Grid
      container
      justify="center"
      alignItems="center"
      direction="column"
      style={{ minHeight: "80vh" }}
      spacing={5}
    >
      <Grid item>
        <Typography variant="h5" color="blue">
          Login
        </Typography>
      </Grid>
      <Grid item style={{border: "0.2px solid gray"}}>
        <Loggin />
      </Grid>
    </Grid>
    </>
  );
}

const Loggin = () => {
  return (
    <Grid container direction="column" alignItems="center" justify="center">
      <TextField
        variant="outlined"
        label="Email"
        fullwidth
        style={{ marginBottom: "2em" }}
      />
      <TextField
        variant="outlined"
        label="Password"
        fullwidth
        style={{ marginBottom: "2em" }}
      />
      <Button
        size="large"
        variant="contained"
        style={{ background: "blue", color: "white" }}
      >
        Login
      </Button>
    </Grid>
  );
};
